var $docEl = $('html, body'),
	$wrap = $('.main'),
	scrollTop;

$.lockBody = function () {
	if (window.pageYOffset) {
		scrollTop = window.pageYOffset;

		$wrap.css({
			top: -(scrollTop)
		});
	}

	$docEl.css({
		height: "100%",
		overflow: "hidden"
	});
}

$.unlockBody = function () {
	$docEl.css({
		height: "",
		overflow: ""
	});

	$wrap.css({
		top: ''
	});

	window.scrollTo(0, scrollTop);
	window.setTimeout(function () {
		scrollTop = null;
	}, 10);
}

function closeAlbumModal() {
	$.unlockBody();
	setTimeout(function () {
		$('body').removeClass('body-open-album-modal');
	}, 300);


}

function openAlbumModal() {
	$('body').addClass('body-open-album-modal');
	setTimeout(function () {
		$.lockBody();
	}, 400);

}

